function cloakTab() {
    if (localStorage.getItem('cloakTab')!=='true') {
        const link = document.querySelector("link[rel='icon']") || document.createElement('link');
        link.rel = 'icon';
        link.href = '/favicon.webp';
        document.head.appendChild(link);
    } else if (localStorage.getItem('cloakTab')=='true') {
        if (localStorage.getItem('cloakTo')) {
            if (localStorage.getItem('cloakTo')=='canvas') {
                var cloakIconURL = 'data:image/x-icon;base64,';
                var cloakTabName = 'Dashboard';
            } else if (localStorage.getItem('cloakTo')=='gclassroom') {
                var cloakIconURL = 'data:image/svg+xml;base64,';
                var cloakTabName = 'Google Classroom';
            } else if (localStorage.getItem('cloakTo')=='custom') {
                var cloakIconURL = localStorage.getItem('customTabIcon');
                var cloakTabName = localStorage.getItem('customTabName');
            }
            const link = document.querySelector("link[rel='icon']") || document.createElement('link');
            link.rel = 'icon';
            link.href = cloakIconURL;
            document.head.appendChild(link);
            document.title = cloakTabName;
        }
    }
}
window.addEventListener('DOMContentLoaded', function() {
    cloakTab();
});